package com.spov.hellodocent.domain;

public class DisplayDTO {

	private String dp_id;
	private String dp_name;
	private String dp_type;
	private String dp_exp;
	private String dp_uci;
	
	public DisplayDTO() {
		super();
		// TODO Auto-generated constructor stub
	}
	
	
	public String getDp_id() {
		return dp_id;
	}
	public void setDp_id(String dp_id) {
		this.dp_id = dp_id;
	}
	public String getDp_name() {
		return dp_name;
	}
	public void setDp_name(String dp_name) {
		this.dp_name = dp_name;
	}
	public String getDp_type() {
		return dp_type;
	}
	public void setDp_type(String dp_type) {
		this.dp_type = dp_type;
	}
	public String getDp_exp() {
		return dp_exp;
	}
	public void setDp_exp(String dp_exp) {
		this.dp_exp = dp_exp;
	}


	public String getDp_uci() {
		return dp_uci;
	}


	public void setDp_uci(String dp_uci) {
		this.dp_uci = dp_uci;
	}
	
	
	
	
	
}
